/* globals Kicksend: true */

/*
 * shibuyaMailcheck - Provides suggestions for common email typos
 * @restrict attribute
 * @example:
    <div shibuya:form:mailcheck="user.email">
      Did you mean <span>example@<strong>gmail.com</strong></span>?
    </div>
 */

angular.module('shibuya.form.mailcheck', []).directive('shibuyaMailcheck', [function () {
  return {
    scope: true,
    restrict: 'A',
    template: '<div>Did you mean <span>{{ address }}@<strong>{{ domain }}</strong></span>?</div>',
    replace: true,
    link: function(scope, element, attrs) {

      function checkEmail(email) {
        Kicksend.mailcheck.run({
          email: email,
          suggested: function(suggestion) {
            scope.suggestion = suggestion.full;
            scope.address    = suggestion.address;
            scope.domain     = suggestion.domain;
            element.show();
          },
          empty: function() {
            scope.suggestion = null;
            element.hide();
          }
        });
      }

      scope.$watch(attrs.shibuyaMailcheck, function(email) {
        checkEmail(email);
      });

      element.bind('click', function (event) {
        event.preventDefault();
        if (scope.suggestion) {
          scope.$parent.$apply(attrs.shibuyaMailcheck+' = "'+scope.suggestion+'"');
        }
      });

    }
  };

}]);

jQuery(function($) {
  if (!Modernizr.svg) {
    $('img[src*=".svg"]').each(function() {
      var $this = $(this);
      var customFallback = $this.data("svg-fallback");
      var autoFallback   = $this.attr('src').replace('.svg', '.png');
      var src = customFallback || autoFallback;
      $this.attr('src', src);
    });
  }
});

(function() {

  var app = angular.module('stargrin', ['shibuya.form.mailcheck']);

  app.controller('SignupCtrl', ['$scope', '$http', function($scope, $http) {
    $scope.user = { email: '' };
    $scope.processing = false;
    $scope.attempted  = false;
    $scope.complete   = false;

    $scope.clearErrors = function() {
      $scope.attempted = false;
      $scope.responseError = null;
    };

    $scope.submit = function(event, url, listID) {
      event.preventDefault();
      $scope.processing    = true;
      $scope.responseError = null;
      $scope.attempted     = true;

      var data = { list: listID, email: $scope.user.email };
      $http.post(url, data)
        .success(function() {
          $scope.complete = true;
        })
        .error(function(data) {
          $scope.responseError = data.msg;
          $scope.processing    = false;
        });
    };
  }]);

})();

